import React from 'react';


const Cabecera = () => {
return (
  <header className='tc pv4 pv5-ns'>
    <img src='http://tachyons.io/img/logo.jpg' className='br-100 pa1 ba b--black-10 h3 w3' alt='avatar'/>
    <h1 className='f5 f4-ns fw6 mid-gray'>Jasper Whitehouse</h1>
    <h2 className='f6 gray fw2 ttu tracked'>Los Angeles</h2>

    <nav class="f6 fw6 ttu tracked">
      <a class="link dim white dib mr3" href="/" title="Home">Home</a>
      <a class="link dim white dib mr3" href="/" title="About">About</a>
      <a class="link dim white dib mr3" href="/" title="Store">Store</a>
      <a class="link dim white dib" href="/" title="Contact">Contact</a>
    </nav>

  </header>

);
}

export default Cabecera;
